INSERT INTO activites (id, nom, description, departementId) VALUES (1, 'Le droit de concrétiser vos projets de manière sûre', 'Dès amour confondre effet découvrir autour voyager. Honte cours que secret sembler soumettre construire état. Vieil atteindre droit je détail mon saint le.', 1);
INSERT INTO activites (id, nom, description, departementId) VALUES (2, 'Le droit de changer avant-tout', 'Éviter nouveau chute avis. Lettre retomber retrouver. Confondre pencher train presser.', 6);
INSERT INTO activites (id, nom, description, departementId) VALUES (3, 'L''avantage de changer plus rapidement', 'Tenir glace témoin derrière mêler douceur. Sommet puis changement queue résoudre chemise.', 7);
INSERT INTO activites (id, nom, description, departementId) VALUES (4, 'La liberté de concrétiser vos projets plus rapidement', 'Car apercevoir long prévoir ministre rapide demain tenter. Éternel sonner bande lit masse autre haine. Revoir autrement étendue exécuter.', 7);
INSERT INTO activites (id, nom, description, departementId) VALUES (5, 'Le pouvoir d''atteindre vos buts autrement', 'Discours lumière éclairer autant. Ce absolu époque approcher violence épais. Tôt envoyer ouvrir sembler.', 3);
INSERT INTO activites (id, nom, description, departementId) VALUES (6, 'Le droit de rouler plus facilement', 'Habitant attention rouge soit. Anglais voiture siècle juste. Tour poids bord confier quartier.', 5);
INSERT INTO activites (id, nom, description, departementId) VALUES (7, 'La liberté d''évoluer en toute tranquilité', 'Bas reconnaître vert moitié. Parfaitement sourire passé placer déchirer deux colère.', 3);
INSERT INTO activites (id, nom, description, departementId) VALUES (8, 'L''art d''avancer de manière efficace', 'Asseoir drame yeux simple loin demander. Considérer d''abord alors créer geste.', 8);
INSERT INTO activites (id, nom, description, departementId) VALUES (9, 'L''assurance de louer sans soucis', 'Tombe palais enfin paysan rêver miser chaleur amener. Papier ligne vivant.', 6);
INSERT INTO activites (id, nom, description, departementId) VALUES (10, 'La possibilité de concrétiser vos projets en toute tranquilité', 'Rompre mensonge gris joue déclarer écouter. Lutter religion soir champ somme peser. Cheval feuille rocher secours disposer intelligence est.', 8);
INSERT INTO activites (id, nom, description, departementId) VALUES (11, 'Le confort d''évoluer à la pointe', 'Tendre papier plante calmer veiller attacher. Quant À vraiment paysan page. Coeur dos cou envelopper mauvais pendre voyage.', 5);
INSERT INTO activites (id, nom, description, departementId) VALUES (12, 'Le plaisir d''atteindre vos buts de manière efficace', 'Appeler unique moyen violent. Sortir instinct hiver montagne. Composer madame prendre visage but peau eaux.', 3);
